# 554. Brick Wall
from typing import List


class _554_Solution:
    def leastBricks(self, wall: List[List[int]]) -> int:
        if not wall or not wall[0]: return 0
        gap, base = set(), [[0] for _ in range(len(wall))]
        for row, lst in enumerate(wall):
            curr = base[row]
            for size in lst:
                curr.append(curr[-1] + size)
                gap.add(base[row][-1])
        lst = sorted(list(gap))
        indexes = [1] * len(wall)
        minimal = len(indexes)
        for step in lst[:-1]:
            accumulator = 0
            for row, index in enumerate(indexes):
                if base[row][index] <= step and indexes[row] < len(base[row]):
                    indexes[row] += 1
                if base[row][index] == step:
                    accumulator += 1
            minimal = min(minimal, len(indexes) - accumulator)
        return minimal

    def leastBricks(self, wall: List[List[int]]) -> int:
        if not wall or not wall[0]: return 0
        holder, minimal, height = {}, len(wall), len(wall)
        for lst in wall:
            width = 0
            for size in lst[:-1]:
                width += size
                acc = holder.get(width, 0) + 1
                holder[width] = acc
                minimal = min(minimal, height - acc)
        return minimal


